// link to css
// import './styles.css';
function App() {
  const [htmlContent, setHtmlContent] = useState('');

  useEffect(() => {
    fetch('/templates/login.html')
      .then(response => response.text())
      .then(data => setHtmlContent(data));
  }, []);
  return (
    <div dangerouslySetInnerHTML={{ __html: htmlContent }}>

    </div>
  )
}

export default App
